(window.webpackJsonp=window.webpackJsonp||[]).push([[439],{794:function(n,h,t){"use strict";t.r(h);var i=t(44),g=Object(i.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-1372-ta-rat-đuoc"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-1372-ta-rat-đuoc"}},[n._v("#")]),n._v(" Chương 1372: Ta rất được")]),n._v(" "),t("hr"),n._v(" "),t("p",[n._v("Chương 1372: Ta rất được"),t("br"),t("br"),n._v("Không biết qua bao lâu, lôi điện biến mất, Phong lão mặt mày xám xịt từ trong hố bò lên đi ra, trên mặt biểu lộ, giống như là bị man thú cưỡng dâm không biết bao nhiêu lần, muốn bao nhiêu thất lạc liền có bao nhiêu thất lạc."),t("br"),t("br"),n._v("Trước mắt rất nhiều kiến trúc cùng thư tịch, bị triệt để hủy hoại, không có lực lượng phản kháng ngược lại cũng thôi, có thể... Trời xanh mây trắng, trời quang mây tạnh, đột nhiên lôi điện đan xen, đối với mình bổ đến bổ đi, đến cùng tình huống gì?"),t("br"),t("br"),n._v("Chỉ là muốn thu cái đồ đệ mà thôi... Không tính tội ác tày trời, xúc phạm luật trời đi..."),t("br"),t("br"),n._v("May mắn những này lôi điện chỉ đem lấy giáo huấn hương vị, cũng không có chân chính hạ sát thủ, nếu không coi như hắn là Thánh vực cửu trọng đỉnh cao cường giả, cũng nhất định chống lại không được, sớm đã bị đánh thành cặn bã."),t("br"),t("br"),n._v("“Lão sư...” Ngọc Thần đem hắn từ trong hố rút ra, mặt mũi rầu rĩ, cũng không biết cái kia an ủi, hay là nên nói cái gì."),t("br"),t("br"),n._v("Đi theo lão sư hơn hai trăm năm, còn là lần đầu tiên thấy hắn bộ dáng này."),t("br"),t("br"),n._v("“Đều tại ta...”"),t("br"),t("br"),n._v("Nhìn thấy trước đó còn hăm hở lão giả, ngắn ngủi chừng mười phút đồng hồ công phu biến thành bộ dáng này, Trương Huyền tràn đầy áy náy."),t("br"),t("br"),n._v("Liên tục mấy lần thí nghiệm, đã triệt để rõ ràng, cùng trước đó đối phương nói đồng dạng, quả thực là Thiên Đạo trừng phạt."),t("br"),t("br"),n._v("Thiên Cơ sư nhìn trộm thiên địa đại đạo, không cách nào phát giác, ngược lại cũng thôi, bản thân thân là Thiên Đạo thư viện chưởng khống giả, đi tới trước mặt, một khi câu thông, loại này vi phạm đồ vật liền sẽ lập tức bị phát hiện."),t("br"),t("br"),n._v("Thật giống như kiểm tra gian lận, không có phát giác, có thể ung dung ngoài vòng pháp luật, bị phát hiện, không trừng trị, như thế nào lập uy?"),t("br"),t("br"),n._v("Nếu không, thiên đạo uy nghiêm ở đâu?"),t("br"),t("br"),n._v("Quyền uy ở đâu?"),t("br"),t("br"),n._v("Người người đều tới nhìn trộm một chút, vụng trộm tìm kiếm thiên cơ... Thiên Đạo đoán chừng cũng không cần sống!"),t("br"),t("br"),n._v("Lúc đầu mượn nhờ thư viện, chỉ là muốn kiểm tra Phong lão, hình thành thư tịch, nhìn một chút có thể hay không giúp hắn giải quyết thể lực tai hoạ ngầm, nằm mơ đều không có nghĩ đến, vừa nhìn đối phương, chẳng khác nào nghề nghiệp của hắn bị Thiên Đạo phát giác, sau đó lôi điện liền đến, dò xét một lần, đánh một lần, liên tục thí nghiệm nhiều lần, rốt cục triệt để xác nhận..."),t("br"),t("br"),n._v("Cái này ngoạn ý, là hắn làm tới..."),t("br"),t("br"),n._v("Chủ ý là cứu người, kết quả lại trở thành hại người..."),t("br"),t("br"),n._v("Suy nghĩ một chút đều tràn đầy xấu hổ."),t("br"),t("br"),n._v("“Thiên Cơ sư sách không thể nhìn, cái nghề nghiệp này cũng không thể điều tra... Nhìn tới ta là không có cách nào học...”"),t("br"),t("br"),n._v("Đồng thời, Trương Huyền cũng lộ ra vẻ thất vọng."),t("br"),t("br"),n._v("Cái nghề nghiệp này bất kể nói thế nào đều đạt đến thượng cửu lưu cấp bậc, được người kính ngưỡng cùng tôn trọng, nếu như có thể học được, thân phận và địa vị tất nhiên sẽ lần nữa tăng thêm."),t("br"),t("br"),n._v("Kết quả, thư viện không những không giúp hắn ngưng tụ suốt ngày đạo thư tịch, còn bốn phía phá hư... Xem ra cùng loại nghề nghiệp này triệt để vô duyên."),t("br"),t("br"),n._v("“Phong lão, sự tình hôm nay thực sự xin lỗi, nếu như ta không tới nơi này, khả năng cũng sẽ không gây ra lớn như thế biến cố...”"),t("br"),t("br"),n._v("Đi tới một mặt mê man lão giả trước mặt, Trương Huyền ôm quyền, thật tâm thật ý nói xin lỗi."),t("br"),t("br"),n._v("Những người khác bái không bái sư, toàn bộ Thiên Cơ đường sẽ không nhận bất kỳ ảnh hưởng gì, nhưng mà hắn mang theo Thiên Đạo thư viện, tương đương với mang theo Thiên Đạo... Sau đó lại chạy đến nhìn trộm thiên đạo địa phương..."),t("br"),t("br"),n._v("Đám này Thiên Cơ sư, không có bị toàn bộ đánh chết, liền xem như hạ thủ lưu tình."),t("br"),t("br"),n._v("Nhưng bất kể nói thế nào, nơi này xuất hiện loại tình huống này đều là duyên cớ của hắn, trốn tránh không xong, cũng từ chối không xong, chỉ có thể thản nhiên thừa nhận."),t("br"),t("br"),n._v("“Cùng ngươi không có quan hệ...” Hai mắt vô thần, than thở một tiếng, Phong lão lần nữa lắc đầu."),t("br"),t("br"),n._v("Hắn thấy, đây là bọn họ Thiên Cơ sư, tiết lộ quá nhiều bí mật, cái kia tiếp nhận trừng phạt, trước mắt vị này coi như thiên phú tuyệt cao, cũng không có khả năng không điều khiển Thiên Đạo, đối bọn hắn tiến hành công kích."),t("br"),t("br"),n._v("Cho nên nói tới nói đi, còn là chính mình vấn đề, cùng người khác vô ưu."),t("br"),t("br"),n._v("“Phong lão, nơi này hỗn loạn như thế, chắc hẳn ngươi cũng tạm thời không còn thu đồ chi tâm, ta liền không lại tiếp tục quấy rầy...”"),t("br"),t("br"),n._v("Biết coi như giải thích, đối phương cũng không có khả năng tin tưởng, Trương Huyền không nói thêm lời."),t("br"),t("br"),n._v("“Tốt, ngươi đi về trước đi, chờ ta thu xếp tốt bên này, tra rõ ràng rốt cuộc chuyện gì đã xảy ra, lại đi tìm ngươi...”"),t("br"),t("br"),n._v("Phong lão gật đầu."),t("br"),t("br"),n._v("Toàn bộ cùng nền móng, sào huyệt đều bị mang... Nói nhiều hơn nữa cũng mất tác dụng, còn không bằng làm cho đối phương tạm thời rời đi, tự nghĩ biện pháp tìm ra vấn đề, làm dịu xấu hổ, lại nói thu đồ không thu đồ đệ vấn đề."),t("br"),t("br"),n._v("Nếu không, bộ dáng này, muốn nhận đồ, người ta cũng không có khả năng bằng lòng ah!"),t("br"),t("br"),n._v("“Cáo từ!”"),t("br"),t("br"),n._v("Lắc đầu, Trương Huyền xoay người đi ra ngoài."),t("br"),t("br"),n._v("Thấy hắn rời đi, Lạc Huyền Thanh theo sát mà đi tới."),t("br"),t("br"),n._v("Rời đi thần thức có khả năng phát giác phạm vi, cũng nhịn không được nữa, dậy không nổi trước mặt, thấp giọng: “Trương sư, vừa rồi đến cùng chuyện gì xảy ra?”"),t("br"),t("br"),n._v("“Ta cũng không rõ ràng lắm...” Trương Huyền lắc đầu."),t("br"),t("br"),n._v("ngantruyen.com/ để  đọc truyện"),t("br"),n._v("Loại sự tình này liền xem như anh vợ cũng không thể nói nhiều, dính dáng thực sự quá lớn."),t("br"),t("br"),n._v("“Không biết?” Thấy hắn như thế trả lời, Lạc Huyền Thanh nhíu nhíu mày, cuối cùng vẫn là nhịn xuống, không có hỏi nhiều."),t("br"),t("br"),n._v("Mặc dù tình huống cụ thể không cách nào phỏng đoán, nhưng mà tuyệt đối cùng trước mắt vị này thoát không được quan hệ."),t("br"),t("br"),n._v("Nếu không, người khác tới đều vô sự, hắn vừa xuất hiện, không phải sập nơi này, liền là sập ở đâu?"),t("br"),n._v(" Đều nói mình là phá hư vương, đi đến đâu phá hư đến đó, có thể ngắn ngủi một đoạn thời gian tiếp xúc, trước mắt vị này thế nào cảm giác so với chính mình còn muốn hung mãnh nhiều lắm?"),t("br"),t("br"),n._v("Bản thân làm phá hư, chí ít còn có dấu vết mà theo, không phải lực lượng dùng quá lớn liền là không có khống chế tốt tu vi... Người này, đem trọn cái Thiên Cơ đường triệt để làm phế, không có bất kỳ cái gì dấu vết có thể dò xét..."),t("br"),t("br"),n._v("Đây mới là phá hư cảnh giới tối cao, làm người ta kính nể."),t("br"),t("br"),n._v("“Xem ra sau này, phải thật tốt cùng hắn trao đổi một chút, như thế nào làm phá hư, mới có thể thần không biết quỷ không hay...”"),t("br"),t("br"),n._v("Đỡ lấy cái cằm, âm thầm suy nghĩ."),t("br"),t("br"),n._v("“Đúng rồi, cùng ngươi đi ra, quên đánh Trương Thuần một hồi...”"),t("br"),t("br"),n._v("Cảm khái nửa ngày, đột nhiên nhớ tới một việc, Lạc Huyền Thanh vỗ trán một cái."),t("br"),t("br"),n._v("Lão nghĩ đến hỏi thăm có phải hay không Thiên Cơ đường sự tình cùng trước mắt vị này liên quan đến, quên lần này tới mục đích chủ yếu."),t("br"),t("br"),n._v("Trương Thuần tên kia còn tại bên trong không có đi ra, chưa kịp đánh hắn một trận..."),t("br"),t("br"),n._v("Gặp lên mà không ra tay, chẳng phải tương đương, thật vất vả đột phá tu vi, lại không địa phương khoe khoang?"),t("br"),t("br"),n._v("“Chạy tới đánh người, quá tầm thường... Thật muốn đánh hắn, không cần đi tìm, có thể để cho chính hắn tìm tới cửa...” Trương Huyền nói."),t("br"),t("br"),n._v("“Ồ?” Lạc Huyền Thanh nhìn qua: “Làm thế nào?”"),t("br"),t("br"),n._v("“Rất đơn giản, Thánh tử điện rất nhiều chức nghiệp bên trong có hay không Trương gia con cháu khá cao?”"),t("br"),t("br"),n._v("Trương Huyền nhìn lại."),t("br"),t("br"),n._v("“Đương nhiên!” Hừ một tiếng, Lạc Huyền Thanh mang theo không vui: “Mặc dù Trương gia người, từng cái nhân phẩm thao đản, nhưng mà thiên phú quả thực không phải là dùng để trưng cho đẹp, không ít người không chỉ thực lực không tệ, phụ tu chức nghiệp cũng đều học rất tốt...”"),t("br"),t("br"),n._v("Trương gia người mạnh mẽ, không chỉ thể hiện tại sức chiến đấu, tại cái khác chức nghiệp, cũng đều có rất cao thành tích."),t("br"),t("br"),n._v("Nguyên nhân chính là như vậy, mới tại Thánh tử điện có như thế lớn thanh danh, người người sợ hãi cùng kính nể, bảo vệ đệ nhất gia tộc địa vị, không người có khả năng dao động."),t("br"),t("br"),n._v("“Vậy là tốt rồi, loại trừ Trương Thuần, nổi danh nhất là ai, mang ta tới, ta muốn khiêu chiến phụ tu!”"),t("br"),t("br"),n._v("Con mắt lộ ra vẻ tàn nhẫn, Trương Huyền mắt sáng lên: “Chỉ cần một đường khiêu chiến đi qua, không tin vị này Trương Thuần không ra mặt!”"),t("br"),t("br"),n._v("Thiên Cơ đường sự tình mặc dù trong thời gian ngắn đoán không được bản thân, nhưng mà thời gian lâu dài, nhất định có thể nghĩ ra cùng mình liên quan đến."),t("br"),t("br"),n._v("Trọng yếu nhất chính là, đã biết, vị kia Dương Huyền thật tồn tại... Người này không xuất hiện ngược lại cũng thôi, một khi phủ nhận thân phận của hắn, Thiên Đạo thư viện liền vô cùng có khả năng tiết lộ, trở thành mục tiêu công kích."),t("br"),t("br"),n._v("Danh sư đại lục, sở dĩ không giống địa phương khác như thế, không tuân thủ quy củ, giết người đoạt bảo, nguyên nhân trọng yếu nhất, cũng là bởi vì sư thừa, người người cũng biết, đánh tiểu nhân, tới lão nhân, một cái chi mạch đan xen chằng chịt, ai cũng không biết, có thể dính dáng bao sâu... Bởi vậy, không xuất hiện sinh tử đại thù, bình thường không biết ra tay."),t("br"),t("br"),n._v("Nghe nói năm đó phong hào đế quốc ở dưới một cái tam đẳng Thánh Nhân quý tộc, tùy tiện xử lý cái Hóa Phàm cảnh giới tiểu nhân vật, liền dính dáng ra cửu tinh luyện khí sư tổ sư gia gia... Cuối cùng dẫn đến toàn cả gia tộc sụp đổ, suýt chút nữa bởi vậy diệt tộc."),t("br"),t("br"),n._v("Từ đó về sau, chỉ cần tuôn ra truyền thừa, bình thường có rất ít người dám động, hắn một đường đi tới, như vậy chắc chắn, thậm chí liền cái đánh lén ám sát đều không có, “Dương Huyền” cái tên này, tuyệt đối lên tác dụng rất lớn."),t("br"),t("br"),n._v("Nếu như không phải chân thực tồn tại, chỉ sợ, nhiều lần như vậy xông đường thành công, Danh Sư đường tổng bộ, cũng đã sớm phái người tới dò xét."),t("br"),t("br"),n._v("Cho nên, thời gian không đợi người, nhất định phải đuổi tại những người khác phát giác, hắn có khả năng che đậy thiên cơ; Vị kia Dương Huyền đi tìm trước khi đến, đạt tới bát tinh danh sư, mở ra phong ấn, trở thành chân chính điện chủ, hoặc là đạt tới cao hơn tu vi."),t("br"),t("br"),n._v("Có điện chủ thân phận, bất kể là ai, cho dù là Danh Sư đường tổng bộ, muốn tìm phiền toái, đoán chừng cũng muốn cân nhắc một chút."),t("br"),t("br"),n._v("Vị này anh vợ, muốn đi đánh Trương Thuần, suy đi nghĩ lại, không bằng thừa cơ đem Trương gia người, toàn bộ thu thập một chút."),t("br"),t("br"),n._v("Trước đó Phí sư cũng nói, mỗi một cái trở thành điện chủ người, đều muốn trải qua đủ loại khiêu chiến, một đường nghiền ép, mới có thể nổi bật uy hiếp, đã hắn là điện chủ duy nhất người hậu tuyển, vậy liền sẽ không có gì có thể ẩn trốn, buông tay đi làm đi."),t("br"),t("br"),n._v("Không quấy toàn bộ Thánh tử điện, long trời lở đất, liền không họ Trương!"),t("br"),t("br"),n._v("“Khiêu chiến phụ tu?”"),t("br"),t("br"),n._v("Lạc Huyền Thanh chần chờ một chút: “Của ngươi trận pháp rất lợi hại, thuần thú cũng cực kỳ cường đại, nhưng cái khác phụ tu, Trương gia người cũng đều không yếu, ngươi xác định... Có khả năng vượt qua, mà không phải bị đối phương giáo huấn?”"),t("br"),t("br"),n._v("Không phải hắn không tin trước mắt vị này."),t("br"),t("br"),n._v("Thuật nghiệp hữu chuyên công, nghe đạo có trước sau, liền xem như danh sư, cũng không có khả năng bất kỳ nghề nghiệp nào đều mạnh, trước mắt vị này tại trên trận pháp cùng thuần thú bên trên trình độ, hắn mười phần tin phục, có thể những nghề nghiệp khác, vừa nghĩ tới những cái kia người Trương gia lưu lại ghi chép, liền xem như hắn, đều cảm thấy có chút nhìn thấy mà giật mình."),t("br"),t("br"),n._v("Đi qua có thể đánh mặt ngược lại cũng thôi, ngộ nhỡ không thành công, bị người đánh, cũng có chút xấu hổ..."),t("br"),t("br"),n._v("“Yên tâm, chỉ cần tìm cho ta đến đầy đủ thư tịch, muốn đánh mặt của ta... Chỉ sợ, còn không có dễ dàng như vậy!”"),t("br"),t("br"),n._v("Mắt sáng lên, Trương Huyền khẽ nói."),t("br"),t("br"),n._v("“Đã ngươi có tự tin, vậy là tốt rồi, ta vừa vặn còn muốn đi một chuyến khải linh sư công hội, ngươi có muốn hay không đi?”"),t("br"),t("br"),n._v("Thấy hắn nói như vậy, nhớ tới thanh niên đủ loại thần kỳ, Lạc Huyền Thanh dừng lại một chút, nói."),t("br"),t("br"),n._v("“Khải linh sư công hội?”"),t("br"),t("br"),n._v("Trương Huyền nhìn qua: “Nhưng có Trương gia người?”"),t("br"),t("br"),n._v("“Trương Thuần em ruột, Trương Phong, liền là trong đó Thánh tử... Bất quá, cấp bậc của hắn đã đạt đến bát tinh... Ngươi có được hay không?”"),t("br"),t("br"),n._v("Nhẹ gật đầu, Lạc Huyền Thanh vẫn còn có chút lo lắng."),t("br"),t("br"),n._v("“Khải linh sư? Trương Thuần em ruột?”"),t("br"),t("br"),n._v("Khóe miệng nâng lên, Trương Huyền nhẹ nhàng cười một tiếng: “Yên tâm đi, nam nhân tại sao có thể nói không được! Nếu như vị này Trương Phong nhân phẩm cũng không tệ lắm, khảo hạch một chút khải linh sư liền thôi, nếu là cùng ca ca hắn đồng dạng thấp kém, vậy liền không khách khí...”"),t("br"),t("br"),n._v("Người đăng: ThấtDạ"),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-1380"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-1382"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=g.exports}}]);